import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
  { id: "e1", title: "Event 1" },
  { id: "e2", title: "Event 2" },
  { id: "e3", title: "Event 3" },
  { id: "e4", title: "Event 4" },
];

export default function EventsPage() {
  return (
    <>
      <h1>We are in the events page</h1>
      <ul>
        {DUMMY_EVENTS.map((event) => (
          <li>
            <Link to={event.id}>{event.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
}
